import React, { useEffect, useState } from "react";
import "./PaginationSlider.sass";

const PaginationSlider = ({ loading, callBackPagination = (index) => {}, pageCount = 10 }) => {
  const [spaced, setSpaced] = useState(false);
  const [leftRow, setLeftRow] = useState([]);
  const [rightRow, setRightRow] = useState([]);
  const [index, setIndex] = useState(0);

  useEffect(() => {
    handleSpaced();
  }, [index]);

  const handleSpaced = () => {};

  const Blocks = ({ indexes }) => {
    return (
      <>
        {indexes.map((row) => (
          <div
            key={row}
            className={`block_index ${index === row}`}
            onClick={() => {
              setIndex(row);
            }}
          >
            {row + 1}
          </div>
        ))}
      </>
    );
  };
  return (
    <div className="pagination_container">
      <div className="left"></div>
      <div className="pages_index">
        <Blocks indexes={leftRow} />
        <div className="spaces">...</div>
        <Blocks indexes={rightRow} />
      </div>
      <div className="right"></div>
    </div>
  );
};

export default PaginationSlider;
